import { GoogleLLM } from "@langchain/google-gauth";
/**
 * Integration with a LLM model.
 */
export class VertexAI extends GoogleLLM {
    static lc_name() {
        return "VertexAI";
    }
    constructor(fields) {
        super({
            ...fields,
            platformType: "gcp",
        });
    }
}
